    {
      company: "HubSpot Inc",
      ticker: "HUBS",
      stockPrice: "115.22 USD",
      timeElapsed: "12 sec ago",
    },
  ];
class Home extends React.Component{

    render(){
        return(
            <div className="home">
            <div className="row">
            <div className="column">
                <h1>left side</h1>
            </div>
            <div className="column"></div>
            <h1>rightsaide</h1>
          </div>
          </div>
        )
    }
}

export default Home;
